import React from 'react';
import styled from 'styled-components';
import { motion } from 'framer-motion';

const Contact = () => {
  return (
    <ContactContainer>
      <Header>
        <Title
          initial={{ opacity: 0, y: -50 }}
          animate={{ opacity: 1, y: 0 }}
          transition={{ duration: 0.5 }}
        >
          Contate-nos
        </Title>
      </Header>
      <Content>
        <FormContainer
          initial={{ opacity: 0 }}
          animate={{ opacity: 1 }}
          transition={{ duration: 0.8 }}
        >
          <form>
            <FormRow>
              <Label htmlFor="name">Nome</Label>
              <Input type="text" id="name" name="name" required />
            </FormRow>
            <FormRow>
              <Label htmlFor="email">Email</Label>
              <Input type="email" id="email" name="email" required />
            </FormRow>
            <FormRow>
              <Label htmlFor="message">Mensagem</Label>
              <Textarea id="message" name="message" required></Textarea>
            </FormRow>
            <Button type="submit">Enviar</Button>
          </form>
        </FormContainer>
        <InfoContainer
          initial={{ opacity: 0 }}
          animate={{ opacity: 1 }}
          transition={{ duration: 1 }}
        >
          <p>
            Endereço: Rua das Gaivotas n 283, Praia de cima - Pinheira - Palhoça - SC
          </p>
          <p>
            Telefone: <a href="https://api.whatsapp.com/send?l=pt_br&phone=5548999720998&text=Oi,%20estou%20em%20seu%20site%20e%20gostaria%20de%20algumas%20informa%C3%A7%C3%B5es,%20consegue%20me%20ajudar?" target="_blank" rel="noopener noreferrer">48999720998 (WhatsApp)</a>
          </p>
          <MapContainer
            initial={{ opacity: 0 }}
            animate={{ opacity: 1 }}
            transition={{ duration: 1.2 }}
          >
            <iframe
              title="Pousada Pinheira Location"
              src="https://www.google.com/maps/embed?pb=!1m18!1m12!1m3!1d3532.466240697077!2d-48.66569658451125!3d-27.895574427225807!2m3!1f0!2f0!3f0!3m2!1i1024!2i768!4f13.1!3m3!1m2!1s0x95275bbd0bb8b4a3%3A0x2b2d7bff4e9b37c!2sR.%20das%20Gaivotas%2C%20283%20-%20Praia%20de%20Cima%20(Pinheira)%2C%20Palho%C3%A7a%20-%20SC%2C%2088139-399%2C%20Brasil!5e0!3m2!1sen!2sus!4v1638269886543!5m2!1sen!2sus"
              width="100%"
              height="300"
              style={{ border: 0 }}
              allowFullScreen=""
              loading="lazy"
            ></iframe>
          </MapContainer>
        </InfoContainer>
      </Content>
    </ContactContainer>
  );
};

const ContactContainer = styled.div`

  padding: 50px;
  background-color: #b15a00;
  color: #333;
`;

const Header = styled(motion.div)`


  text-align: center;
  margin-bottom: 50px;
`;

const Title = styled(motion.h1)`
  font-size: 2.5rem;
  color: #ffffff;
`;

const Content = styled.div`


  display: flex;
  align-items: flex-start;
  justify-content: space-around;
  flex-wrap: wrap;
`;

const FormContainer = styled(motion.div)`
  flex: 1;

  margin: 20px;
  max-width: 500px;
`;

const FormRow = styled.div`
  margin-bottom: 15px;
`;

const Label = styled.label`
  display: block;
  font-size: 1.2rem;
  margin-bottom: 5px;
`;

const Input = styled.input`
  width: 100%;
  padding: 10px;
  font-size: 1rem;
  border-radius: 5px;
  background-color: #b15a00;
  border: 1px solid #ccc;
`;

const Textarea = styled.textarea`
  width: 100%;
  padding: 10px;
  font-size: 1rem;
  border-radius: 5px;
  border: 1px solid #ccc;
  height: 150px;
`;

const Button = styled.button`
  display: block;
  width: 100%;
  padding: 10px;
  font-size: 1.2rem;
  color: #fff;
  background-color: #008080;
  border: none;
  border-radius: 5px;
  cursor: pointer;

  &:hover {
    background-color: #006666;
  }
`;

const InfoContainer = styled(motion.div)`

  flex: 1;
  margin: 20px;
  max-width: 500px;
  p {
    font-size: 1.2rem;
    line-height: 1.6;
    margin-bottom: 20px;
  }
  a {
    color: #fffff;
    text-decoration: none;

    &:hover {
      text-decoration: underline;
    }
  }
`;

const MapContainer = styled(motion.div)`
  width: 100%;
  margin-top: 20px;
`;

export default Contact;
